import React from "react";
import CurrentLocation from "./currentLocation";
import "./App.css";

function App() {
  return (
    <React.Fragment>
      <div className="container">
        <CurrentLocation />
      </div>
      <div style={{ textAlign: "center", padding: "1rem", fontSize: "0.9rem", color: "#555", borderTop: "1px solid #ddd", marginTop: "3rem", fontFamily: "sans-serif" }}>
        © {new Date().getFullYear()} Made by <strong>Jidnyesh Chaudhari</strong> · <a href="https://www.linkedin.com/in/jidnyeshchaudhari" target="_blank" rel="noopener noreferrer" style={{ color: "#0077b5", textDecoration: "none" }}>LinkedIn</a> | <a href="https://github.com/jidnyeshchaudhari" target="_blank" rel="noopener noreferrer" style={{ color: "#333", textDecoration: "none" }}>GitHub</a>
      </div>
    </React.Fragment>
  );
}

export default App;
